/*Table structure for table `complaint` */

DROP TABLE IF EXISTS `complaint`;

CREATE TABLE `complaint` (
  `cid` int(100) NOT NULL auto_increment,
  `userid` varchar(1000) default NULL,
  `cname` varchar(1000) default NULL,
  `desc` varchar(1000) default NULL,
  `status` varchar(1000) default NULL,
  `cdate` varchar(1000) default NULL,
  `adate` varchar(1000) default NULL,
  PRIMARY KEY  (`cid`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=latin1;

/*Data for the table `complaint` */

insert  into `complaint`(`cid`,`userid`,`cname`,`desc`,`status`,`cdate`,`adate`) values (1,'kishan','ROADS','VERY HORRIBLE','citizen','22:10:2018','24:10:2018');

/*Table structure for table `feedback` */

DROP TABLE IF EXISTS `feedback`;

CREATE TABLE `feedback` (
  `fid` int(100) NOT NULL auto_increment,
  `userid` varchar(1000) default NULL,
  `dept` varchar(1000) default NULL,
  `desc` varchar(1000) default NULL,
  `date` varchar(1000) default NULL,
  `count` varchar(1000) default NULL,
  PRIMARY KEY  (`fid`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=latin1;

/*Data for the table `feedback` */

insert  into `feedback`(`fid`,`userid`,`dept`,`desc`,`date`,`count`) values (1,'kishan','water','very nice','22:10:2018','0');

/*Table structure for table `login` */

DROP TABLE IF EXISTS `login`;

CREATE TABLE `login` (
  `id` int(11) NOT NULL auto_increment,
  `userid` varchar(1000) default NULL,
  `password` varchar(100) default NULL,
  `utype` varchar(100) default NULL,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=latin1;

